import React, { useState } from 'react';
import Popup from './Popup'

function Information() {
  const [shouldOpenMyDiv, setShouldOpenMyDiv] = useState(false);


  return (
    <section className="resume-section" id="about">
      <div className="resume-section-content">
        <h1 className="mb-0">
          <span className="text-primary">Duong Long</span>
        </h1>
        <div className="subheading mb-5">
          Address: Vinh Thinh - Dai Ang - Thanh Tri - Ha Noi
        </div>
        <div className="subheading mb-5">
          Email: "
          <a href="mailto:name@email.com">nduonglong02@gmail.com</a>
          ".
        </div>
        <p className="lead mb-5">I am experienced in leveraging agile frameworks to provide a robust synopsis for high level overviews. Iterative approaches to corporate strategy foster collaborative thinking to further the overall value proposition.</p>
        <div className="social-icons">
          <a className="social-icon" href="#!"
            onClick={() => setShouldOpenMyDiv(true)}
          >
            <i className="fab fa-linkedin-in" />
          </a>
          <a className="social-icon" href="#!"><i className="fab fa-github" /></a>
          <a className="social-icon" href="#!"><i className="fab fa-twitter" /></a>
          <a className="social-icon" href="https://www.facebook.com/duonglong26"><i className="fab fa-facebook-f" /></a>
        </div>
        {shouldOpenMyDiv &&
          <Popup
            shouldOpenMyDiv={false}
            onSelect={() => setShouldOpenMyDiv(false)}
          />
          // <div>
          //   <h1>
          //   Hi, my name is Long
          //   </h1>
          //   <button className="" onClick={() => setShouldOpenMyDiv(false)}>
          //     Close
          //   </button>
          // </div>
        }
      </div>
    </section>
  );
}

export default Information;
